				"text": "<p>Hurls Glue Bomb.</p>\n<p><em><strong>Glue Bomb.</strong></em>&nbsp;Each creature within 10 feet of the bomb&rsquo;s target point must succeed on a DC 11 Dexterity saving throw or be&nbsp;<a class=\"tooltip-hover condition-tooltip\" href=\"https://www.dndbeyond.com/compendium/rules/basic-rules/appendix-a-conditions#Restrained\" data-tooltip-href=\"//www.dndbeyond.com/conditions/13-tooltip?disable-webm=1&amp;disable-webm=1\">restrained</a>. The target or another creature within reach of it can use an action to make a DC 11 Strength check; if the check succeeds, the effect on the target ends.</p>",
				"plain": "Hurls Glue Bomb.Glue Bomb. Each creature within 10 feet of the bomb’s target point must succeed on a DC 11 Dexterity saving throw or be restrained. The target or another creature within reach of it can use an action to make a DC 11 Strength check; if the check succeeds, the effect on the target ends.",
